INSERT INTO `smartrules` VALUES (1,'quotesImprove','quotes','quotes','rules','//created on: Sep 30, 2014\r\npackage rules\r\n\r\n//list any import classes here.\r\n\r\nimport com.farmers.batch.kyn.Agentmonthly;\r\nimport com.farmers.batch.kyn.AgentActions;\r\n\r\n//declare any global variables here\r\n\r\nglobal com.farmers.batch.kyn.AgentActions agentactions;\r\n\r\ndialect \"mvel\"\r\n\r\nrule \"ImproveQuote : Agent close rate and retention\"\r\n\r\n    when\r\n        $agentmonthly : Agentmonthly(closerate >= 50 && closerate <= 75, retention >= 30 && retention <= 50)\r\n       \r\n    then\r\n        System.out.println(\" Improve quoting --> \"+ $agentmonthly.toString());\r\n        agentactions.addAction($agentmonthly,\"Quotes\",\"Increase quoting percentage by 18.6% for better retention\");\r\n\r\nend\r\n\r\n\r\n'),(2,'rentiongood','quotes','quotes','rules','//created on: Sep 30, 2014\r\npackage rules\r\n\r\n//list any import classes here.\r\n\r\nimport com.farmers.batch.kyn.Agentmonthly;\r\nimport com.farmers.batch.kyn.AgentActions;\r\n\r\n//declare any global variables here\r\n\r\nglobal com.farmers.batch.kyn.AgentActions agentactions;\r\n\r\ndialect \"mvel\"\r\n\r\nrule \"Retentionrule : Agent close rate and retention\"\r\n\r\n    when\r\n        $agentmonthly : Agentmonthly(closerate >= 50 , retention >= 50)\r\n       \r\n    then\r\n        System.out.println(\" Improve Retention --> \"+ $agentmonthly.toString());\r\n        agentactions.addAction($agentmonthly,\"Retention\",\"Maintain pif for better retention.\");\r\n\r\nend\r\n\r\n\r\n'),(3,'focusarea','focusarea','performance','rules','//created on: Sep 30, 2014\npackage rules\n\n//list any import classes here.\n\nimport com.farmers.batch.kyn.Reportview;\nimport com.farmers.batch.kyn.AgentActions;\n\n//declare any global variables here\n\nglobal com.farmers.batch.kyn.AgentActions agentactions;\n\ndialect \"mvel\"\n\nrule \"Focus Area : Message\"\n\n    when\n        $reportview : Reportview(focusarea == \'Y\')\n       \n    then\n        System.out.println(\" Focus Area --> \"+ $reportview.toString());\n        agentactions.addAction($reportview,\"Focus Area\",\"your oppurtunity for the quarter \" + $reportview.getId().getQuarter() +\", is \"+$reportview.getId().getDatacategory());\n\nend\n\n\n');
/*!40000 ALTER TABLE `smartrules` ENABLE KEYS */;
