  `retention` decimal(10,2) DEFAULT NULL,
  `closerate` decimal(10,2) DEFAULT NULL,
  `updatetime` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`statecd`,`lob`,`year`,`month`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
